                  {data.uni_degree_3 && <section>
                      Degree: {data.uni_degree_3}
                  </section>}

                  {data.uni_gpa_3 && <section>
                      GPA: {data.uni_gpa_3}
                  </section>}

                  {data.uni_major_3 && <section>
                      Major/Focus: {data.uni_major_3}
