          </section>
          <section className="result_section result_rec_whole">
              <h3>Recommenders</h3>
              {data.recommender && <section className='result_text result_rec'> {data.recommender}
              </section>}
          </section>
        </section>
    </section>

    </>
  )
}
export default ResultPage;
